import React from 'react';
import logo from './logo.svg';
import './App.css';
import array_list from './profile';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>

      <div className="container-div">
        {array_list.map((item) => (
          <div className="container-pokemon">
            <img className='image-pokemon' src="https://66.media.tumblr.com/tumblr_ma4ft6OXxw1rfjowdo1_500.gif" alt={item.name_pokemon}/>
            <p className='name-pokemon'>Nombre: {item.name_pokemon}</p>
            <p className='power-pokemon'>Poder: {item.power_pokemon}</p>
            <p className='description-pokemon'>Descripci√≥n: {item.description_pokemon}</p> 
          </div>
        ))}
      </div>

    </div>
  );
}

export default App;
